import {StyleSheet} from 'aphrodite';
const styles = StyleSheet.create({
    wrap:{
        width: '765px',
        marginBottom: "210px"
    },
    wrap1:{
        width: "676px",
        fontFamily: 'SFUIDisplay-Light',
        fontSize: "20px",
        fontWeight: 300,
        lineHeight: "30px"
    },
    wrap2:{
        position: "relative",
        height: "550px",
        width: "100%"
    },
    img2:{
        position: "absolute",
        right: 0,
        bottom: 0 
    }
});
export default styles;
